# Перебор файлов в директории
for filename in os.listdir(directory):
    if filename.endswith('.xml'):
        # Полный путь к файлу
        filepath = os.path.join(directory, filename)

        # Парсинг XML-файла
        tree = ET.parse(filepath)
        root = tree.getroot()

        # Получение значения beginTime
        begin_time = root.find('.//ns:measCollec', namespace).get('beginTime')
        begin_time = datetime.fromisoformat(begin_time).strftime('%Y-%m-%d %H:%M:%S')

        # Получение всех элементов measInfo (измерительная задача FunctionSubSet Name,
        # содержащая в себе счётчики, например KPI Measurement <per Cell>)
        for measInfo in root.findall('.//ns:measInfo', namespace):
            # Получение значения measInfoId
            measInfoId = measInfo.get('measInfoId')

            if measInfoId in measInfoId_list:
                # Получение значения из элемента measTypes (список счётчиков в этой задаче)
                measTypes = measInfo.find('ns:measTypes', namespace).text.strip().split()
                #print('measTypes= ', measTypes)
                measTypes_list += measTypes
                #print('meastype_list= ', measTypes_list)

                # Получение всех элементов measValue внутри выбранного measInfo (measValue содержит соту и значения счётчиков )
                for measValue in measInfo.findall('ns:measValue', namespace):
                    # Извлечение значений из элементов measObjLdn и measResults
                    measObjLdn = measValue.get('measObjLdn') # сота
                    measResults = measValue.find('ns:measResults', namespace).text # значения счётчиков

                    # Разделение значения measResults по пробелу и создание списка значений(разбить строку с счётчиками на список)
                    measResults_list = measResults.split()

                    # Создание словаря для хранения данных текущей записи (measInfoId - наверное здесь не нужен)
                    record = {'begin_time': begin_time, 'measObjLdn': measObjLdn, 'measInfoId': measInfoId}

                    # Добавление значений из measResults_list в словарь с использованием новых названий из общего словаря конверсии
                    # т.е. замена counter ID на counter Name (measTypes - список счётчиков)
                    for i, measType in enumerate(measTypes):
                        if measType in meas_info_conversion:
                            converted_measType = meas_info_conversion[measType]  # конвертирование названий счётчиков
                            record[converted_measType] = measResults_list[i]  #  добавление в результирующий словарь

                    # Добавление записи в словарь данных для текущего measInfoId
                    if measInfoId in data:
                        data[measInfoId].append(record)
                    else:
                        data[measInfoId] = [record]

